results.description:
You need Pitch Modifier in two cases: 1) you want a new sound; 2) you want to have fun! You can easily change audio speed and transform your voice. 

- Choose any file from your library or record your track;
- Change the pitch using just one slider;
- Apply sound effects - delay, distortion, reverb;
- Enjoy pleasant visualization.

Take simple steps and get an amazing result with the Pitch Modifier app!
